import React, { Component } from "react";
import BlogPage from "./accueil";
import Gauche from "./gauche";
import "./Landing.css";
import "./gauche.css";
class Landing extends Component {
  render() {
    return (
      <div class="container-fluid">
        <div class="row">
          <div class="col-sm-6">
          <Gauche/>
          </div>
          <div class="col-sm-6">
          <BlogPage/>
          </div>

        </div>
      </div>

    );
  }
}

export default Landing;
